import React, { useState, useEffect } from 'react';
import CurrentStories from '../../components/CurrentStories/CurrentStories';
import masterpiece from '../../components/Header/header-avatar.jpeg';
import ProfilePosts from '../../components/ProfilePosts/ProfilePosts';
import currentStoriesPhoto1 from '../../icons/profPost1.jpeg';
import currentStoriesPhoto2 from '../../icons/profPost4.jpeg';
import currentStoriesPhoto3 from '../../icons/profPost6.jpeg';
import { Link, useParams } from 'react-router-dom';
import './Profile.scss';

const Profile = () => {
  const [profileData, setProfileData] = useState([]);
  const { data } = useParams();

  useEffect(() => {
    fetch('http://localhost:3003/profile')
      .then((res) => res.json())
      .then((data) => console.log(data));
  }, []);

  console.log(data);
  return (
    <div className="prof">
      <div className="container">
        <div className="prof__header">
          <div className="d">
            <div className="prof__current">
              <img className="prof__current-avatar" src={masterpiece} alt="profile-avatar" />
            </div>
          </div>
          <div className="prof__header-subs">
            <div className="prof__header-inner">
              <h1 className="prof__header-nick">__procherk__</h1>
              <button className="prof__header-edit">Edit Profile</button>
              <div className="prof__header-settings">settings</div>
            </div>
            <ul className="prof__list">
              <li className="prof__item">
                <span>38</span> posts
              </li>
              <li className="prof__item">
                <a className="prof__link" href="#">
                  <span>176</span> followers
                </a>
              </li>
              <li className="prof__item">
                <a className="prof__link" href="#">
                  <span>176</span> followers
                </a>
              </li>
            </ul>
            <div className="prof__subtitle">
              <span className="prof__subtitle-text">drug</span>
              <Link to="platitenalogi" className="prof__subtitle-link">
                @platitenalogi
              </Link>
            </div>
          </div>
        </div>
        <div className="prof__stories">
          <CurrentStories
            currentStoriesPhoto={currentStoriesPhoto1}
            acticeStoriesText="my"
            activeStories={false}
          />
          <CurrentStories
            currentStoriesPhoto={currentStoriesPhoto2}
            acticeStoriesText="лауд"
            activeStories={false}
          />
          <CurrentStories
            currentStoriesPhoto={currentStoriesPhoto3}
            acticeStoriesText="💗"
            activeStories={false}
          />
        </div>
        <ProfilePosts />
      </div>
    </div>
  );
};
export default Profile;
